import Button from "./Button.js";
import Input from "./Input";
import './Login.css';
import googleimg from '../images/google-icons.png';
import ellipseimg from '../images/Ellipse.png';



function Login(){

   return(
       <div  className="login">
       <h1 className="loginHeading">Login </h1>
       <form className="LForm" >
         <div>
         <Input labelName="E-mail ID"/><br></br><br></br>
         </div> 
         <div>
           <Input labelName="Password"/><br></br><br></br>
           </div> 


             <Button BtnName="Login"/><br></br><br></br>
             <div className="loginwith"><p>or login with</p></div><br></br><br></br>
             <div className="rightlogo">
             <div className="google" ><img src={googleimg}></img><p>Google</p></div>
             <div className="facebook"><img src={ellipseimg}></img><p>Facebook</p></div>
             </div>


       </form>

       </div>
   );

   }

export default Login;
